  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arapaho
  National Wildlife Refuge outlines Refuge accomplishments during the 1986 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, manpower programs, volunteer
  programs, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grasslands, and
  grazing. The wildlife section of the report discusses endangered and threatened
  species, waterfowl, marsh birds and waterbirds, raptors, game mammals, fisheries
  resources, wildlife propagation, animal control, and marking and banding. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, fishing, trapping, wildlife observation, outdoor recreation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, major maintenance, equipment
  replacement, and communication systems. Cooperative programs and items of interest
  and brochures are provided at the end. Bamforth, Button Lake and Pathfinder narratives
  are included.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
